    false,nt"url": null,nt"notes": "This annual narrative report for Detroit
    Lakes Wetland Management District outlines District accomplishments during the 1978
    calendar year. The report begins by giving a brief District introduction and describing
    the climate and habitat conditions in the District, as well as the land acquisition
    program, funding, and system status. The construction and maintenance section describes
    recent construction, maintenance, and wildfires. The habitat management section
    discusses wetlands, croplands, grasslands, wilderness and special areas, and easements
    for waterfowl management. Wildlife- including endangered and threatened species,
    migratory birds, upland game birds, big game animals, and raptors- are discussed.
    The public relations sections describes information and interpretation, recreational
    uses, and enforcement. Field investigations, cooperative programs, items of interest,
    and safety are discussed. Photographs are attached.",nt"license_title": "License
